import { React, useState, useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import { bindActionCreators } from "redux";
import { actionCreators } from "../../redux";
// import { fetchProducts } from '../../redux/actionCreators/fetchData';

// import axios from "axios";

const ApiRedux = () => {
  const dispatch = useDispatch();
  const { fetchPosts } = bindActionCreators(actionCreators, dispatch);
  const getRedux = useSelector((state) => state.addItem);
  console.log("getRedux====>>>>>>>>>>>>>>>>", getRedux);
  // const [UsersData, setUsersData] = useState([])

  useEffect(() => {
    // axios.get('https://jsonplaceholder.typicode.com/posts/1').then(response => {
    console.log("useEffect==>");
    // showApiReduxAction(fetchProducts());
    // });
    fetchPosts();
  }, []);

  return (
    <>
      <h1>
        {getRedux.map((Element, index) => {
          return <div key={index}>{Element.title}</div>;
        })}
      </h1>
    </>
  );
};

export default ApiRedux;
